nimport numpy as np\nimport pandas as pd\nimport yaml\nimport dask.array as da\nfrom dask.distributed import performance_report\nfrom dask_ml.decomposition import IncrementalPCA\n\n\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Ssize = data[\"parallelism\"][\"height\"]*data[\"parallelism\"][\"width\"]\n    generations = data[\"MaxtimeSteps\"]\n    Sworkers = data[\"workers\"]\n    timeStep = 1\nC = Initialization(Ssize, Sworkers)\nC.client.get_versions(check=True)\n\n\n# Results \nResults = []\n\n# perf holds different time measurements \n# generation, getdata, get-from-queues, computation \nperf = np.empty([generations//timeStep, 4])\nt = time.perf_counter()\nprint(\"Je suis vivant \", flush=True)\n\nwith performance_report(filename=\"dask-report.html\"):\n    for g in range(0, generations, timeStep):\n        tic3 = time.perf_counter()\n        tic = time.perf_counter()\n        arrays, perf[g//timeStep][2] = C.get_data()\n        arrays = da.reshape(arrays, (arrays.shape[1],arrays.shape[2])) \n        toc = time.perf_counter()\n        perf[g//timeStep][1] = toc - tic\n        tic1 = time.perf_counter()\n        if g==0:\n            pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n            pca.partial_fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1096","type":"BoxAnnotation"},{"attributes":{"coordinates":null,"formatter":{"id":"1207"},"group":null,"major_label_orientation":-0.5,"major_label_policy":{"id":"1456"},"minor_tick_line_alpha":0,"ticker":{"id":"1209"}},"id":"1193","type":"LinearAxis"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1189","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1242"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1244"},"nonselection_glyph":{"id":"1243"},"view":{"id":"1246"}},"id":"1245","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"blue"},"height":{"value":0.9},"line_alpha":{"value":0.2},"line_color":{"value":"blue"},"width":{"field":"bandwidth"},"x":{"field":"bandwidth-half"},"y":{"field":"type"}},"id":"1204","type":"Rect"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth: 513.82 MiB"},"id":"1183","type":"Title"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"tabs":[{"id":"1402"},{"id":"1406"},{"id":"1409"},{"id":"1410"},{"id":"1403"},{"id":"1404"},{"id":"1405"},{"id":"1407"},{"id":"1408"}]},"id":"1411","type":"Tabs"},{"attributes":{},"id":"1198","type":"CategoricalTicker"},{"
